import React from 'react';
import './App.css';
import Container from 'react-bootstrap/Container'
import Table from 'react-bootstrap/Table'

import axios from 'axios';

var obj;
var response;

var id;
var datetime;
var name;
var summary;
var url;
var type
var location;

var forecast;
var daily;
var pm25;
var today

var avg;
var day;
var max;
var min;

var elements;

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get('http://api.waqi.info/feed/stockholm/?token=6460bc98321176676eee4a2d07153eb8854628fe')
      .then(res => {
        obj = res.data;
        response = obj[Object.keys(obj)[1]];
        forecast = response[Object.keys(response)[7]];
        daily = forecast[Object.keys(forecast)[0]];
        pm25 = daily[Object.keys(daily)[2]];
        today = pm25[Object.keys(pm25)[2]];

        avg = JSON.stringify(today[Object.keys(today)[0]]);
        day = JSON.stringify(today[Object.keys(today)[1]]);
        max = JSON.stringify(today[Object.keys(today)[2]]);
        min = JSON.stringify(today[Object.keys(today)[3]]);

        elements = {avg: avg, day: day, max: max, min: min}
        const persons = elements;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <Container>
<Table striped bordered hover size="sm">
<thead>
  <tr>
    <th>Id</th>
    <th>Datetime</th>
    <th>Name</th>
    <th>Summary</th>
    <th>Url</th>
    <th>Type</th>
    <th>Location</th>
  </tr>
  </thead>
  <tbody>
  <tr>
    <td>{ this.state.persons.avg}</td>
    <td>{ this.state.persons.day}</td>
    <td>{ this.state.persons.max}</td>
    <td>{ this.state.persons.min}</td>
  </tr>
  </tbody>
</Table>
</Container>
    )
  }
}
